def ec30_sock(ip):
    s = socket.socket(socket.AF_INET, socket.SOCK_STREAM)
    s.setsockopt(socket.SOL_SOCKET, socket.SO_LINGER, 0)
    s.connect((ip, 3333))
    return s


def sorter_sock():
    socket.setdefaulttimeout(2)
    s = socket.socket(socket.AF_INET, socket.SOCK_STREAM)
    s.setsockopt(socket.SOL_SOCKET, socket.SO_LINGER, 0)
    s.connect((clientip, 58627))
    return s


def get_sortinglocation(current_test):
    with pyodbc.connect(
        "Driver={SQL Server};"
        "Server=w2k16vdb03;"
        "Database=Sorter;"
        "Trusted_Connection=yes;"
    ) as conn:
        cursor = conn.cursor()

        cursor.execute(
            f"select SortingLocationId from SorterDealer where DealerNumber = '{current_test['dealernumber']}'"
        )

        for record in cursor.fetchall():
            return record[0]


